"""**loc** and **iloc** are two different methods in pandas for selecting data from a DataFrame. They differ primarily in how they handle indexing, as well as in their usage for selecting rows and columns.

loc
Label-based indexing: loc is used to access rows and columns by their labels or boolean arrays.
Inclusive: When specifying ranges, both the start and end labels are included.
Usage: It can select data by specifying the row and column labels directly.
![image.png](data:image/png;base64,)
iloc
Integer-based indexing: iloc is used to access rows and columns by their integer positions (i.e., the index positions starting from 0).
Exclusive: When specifying ranges, the start position is included, but the end position is excluded.
Usage: It is useful for selecting data based on the numerical index of the rows and columns.
![image.png](data:image/png;base64,)
![Screenshot 2024-09-01 223240.png](data:image/png;base64,)
"""

